    def text_var(self, text):
        cur_txt = text

        if cur_txt == 'Please select Input':
            self.Mono_groupBox.hide()
            self.J3_groupBox.hide()
            self.Mono_pic.hide()
            self.J3_pic.hide()
            self.J4_pic.hide()

        elif cur_txt == 'Monopile':
            self.Mono_groupBox.show()
            self.J3_groupBox.hide()
            self.Mono_pic.show()
            self.J3_pic.hide()
            self.J4_pic.hide()

        elif cur_txt == 'Jacket 3-Stand':
            self.J3_groupBox.show()
            self.Mono_groupBox.hide()
            self.Mono_pic.hide()
            self.J3_pic.show()
            self.J4_pic.hide()

        else:
            self.J3_groupBox.show()
            self.Mono_groupBox.hide()
            self.Mono_pic.hide()
            self.J3_pic.hide()
            self.J4_pic.show()